// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity ^0.8.1;

import "@openzeppelin/contracts/token/ERC721/extensions/IERC721Enumerable.sol";

/// @title GridCell Interface Detection
interface IGridCell is IERC721Enumerable {
    function getCell(uint256 _cellId) external view returns (
        uint256 cellId, 
        int32[2] memory coordinates, 
        uint256 properties, 
        uint8 team, 
        address owner
    );
    function createCell(
        uint256 _initialProperties, 
        uint8 _initialTeam, 
        address _initialOwner
    ) external returns (uint256 _cellId);
    function getCellGrade(uint256 _cellId, uint256 _properties) external pure returns (uint8 grade);
    function getCellLastTeamEarningsPerStake(uint256 _cellId) external view returns (uint256 lastTotalEarningsPerStake);
    function getStake(uint8 _grade) external pure returns (uint8 stake);
    function getTeamStake(uint8 team) external view returns (uint256 teamStake);
    function getTeamEarnings(uint8 team) external view returns (uint256 teamEarnings, uint256 teamEarningsPerStake);
    function getAllTeamEarnings() external view returns (uint256[8] memory teamEarnings, uint256[8] memory teamEarningsPerStake);
    function getAllTeamStakes() external view returns (uint256[8] memory teamStake);
    function setTeam(uint256 _cellId, uint8 _newTeam) external;
    function setAllTeamEarnings(
        uint256[8] memory _newTeamTotalEarnings, 
        uint256[8] memory _newTeamTotalEarningsPerStake
    ) external;
    function updateCellLastTeamEarningsPerStake(uint256 _cellId) external;
}
